import React from 'react';

const BlockInfo = ({
    id,
    name,
    transactions
}) =>{

    return(
        <div>
            <div className="cold-md-12">{id}</div>
            <div className="cold-md-12">{name}</div>
            <div className="cold-md-12">{transactions}</div>
        </div>
    )
}

export default BlockInfo;
